#include <stdio.h>

#include <stdlib.h>

struct Node {

    int data;

    struct Node* next;

};

int hasCycle(struct Node* head) {

    struct Node *slow = head, *fast = head;

    while (fast != NULL && fast->next != NULL) {

        slow = slow->next;

        fast = fast->next->next;

        if (slow == fast)

            return 1; // Cycle detected

    }

    return 0; // No cycle

}
